import { Routes, Route, Link } from 'react-router-dom';

const ContactoUno = () => {
  return <h2>Contacto 1</h2>;
};

const ContactoDos = () => {
  return <h2>Contacto 2</h2>;
};

const Contacto = () => {
  return (
    <>
      <h1>Contacto</h1>
      <nav>
        <ul>
          <li>
            <Link to="/contacto/uno">Contacto 1</Link>
          </li>
          <li>
            <Link to="/contacto/dos">Contacto 2</Link>
          </li>
        </ul>
      </nav>
      <div>
        <Routes>
          <Route path="/contacto/uno" element={<ContactoUno />} />
          <Route path="/contacto/dos" element={<ContactoDos />} />
        </Routes>
      </div>
    </>
  );
};

function App() {
  return (
    <div>
      <nav>
        <ul>
          <li>
            <Link to="/">Inicio</Link>
          </li>
          <li>
            <Link to="/contacto">Contacto</Link>
          </li>
        </ul>
      </nav>
      <section>
        <Routes>
          <Route path="contacto" element={<Contacto />} />
          <Route index element={<h1>Inicio</h1>} />
        </Routes>
      </section>
    </div>
  );
}

export default App;
